function ComponentsModule(){this.components=[];this.modules={};this.initializeEvent=function(a){let events=a.event.trim().split(" ");if(a.element[0]!==undefined){for(let i=0;i<a.element.length;++i){for(let j=0;j<events.length;++j){a.element[i].addEventListener(events[j],a.content)}}}else{for(let i=0;i<events.length;++i){a.element.addEventListener(events[i],a.content)}}}.bind(this);this.initializeComponent=function(a){if(!(a in this.modules)){return false}a=this.modules[a];if(a.start){a.start()}if(!a.events){return false}let events=a.events;for(let i=0;i<events.length;++i){this.initializeEvent(events[i])}}.bind(this);this.initializeComponents=function(){for(let i=0;i<this.components.length;++i){this.initializeComponent(this.components[i])}}.bind(this);this.start=function(a){this.components=a;this.initializeComponents()}.bind(this);this.serialize=function(){let result={};for(let i=0;i<this.components.length;++i){result[this.components[i]]=this.modules[this.components[i]].serialize()}return result}.bind(this)}let componentsModule=new ComponentsModule();